column8:
●大人気のチェストにマットタイプの新モデルが登場！<br>
●中身が見えないデザインなのでリビングにもピッタリ<br>
●スリムなので、台所や洗面所などのスキ間に！<br>
●クローゼット内の収納としても<br>
●引き出しは特殊レールで開閉がスムーズにできます <br>
●湿気に強い樹脂製なので、バス、サニタリー周りでも活躍<br>
●脚用の滑り止めシート付き<br>
<br>
【サイズ】幅34cm×奥行き42cm×高さ107cm<br>
【材質】ポリプロピレン<br>
【原産国】日本<br>
【カラー】サンドホワイト/サンドブラウン/サンドブルー/サンドピンク/サンドグリーン/ホワイト/ブラウン<br>
